import React from "react";
import "../styles/Home.css";
import { useNavigate } from "react-router-dom";

function Home() {
  const navigate = useNavigate();

  return (
    <div className="home-wrapper">
      <div className="overlay" />

      {/* Top-left heading and tagline */}
      <div className="home-header-left">
        <h1 className="home-logo">
          Bloom Well{" "}
          <span className="home-tagline">
            – When things change inside you, things change around you
          </span>
        </h1>
      </div>

      {/* Main content remains the same */}
      <div className="home-main-content fade-in">
        <div className="home-intro">
          <p>
            Welcome to <strong>Bloom Well</strong> – an AI-powered platform
            dedicated to helping you track emotional well-being through facial
            expression analysis...
          </p>
        </div>

        <div className="home-buttons">
          <button className="btn-get-started">Get Started</button>
          <button className="btn-signin" onClick={() => navigate("/SignIn")}>
            Sign In
          </button>
        </div>

        {/* How It Works and Benefits here... */}
      </div>
    </div>
  );
}

export default Home;
